import React from 'react';
import styled from 'styled-components';

const RepeatEach = () => {
  const Section = styled.section`
    border: 1px red solid;
    width: 375px;
    height: 100px;
    margin: auto;
  `;
  return (
    <Section>
      <Label>Repetir cada</Label>
    </Section>
  )
}

export default RepeatEach
